import React from 'react';
import CustomImage from './CustomImage';

const SingleBookCard = ({ data }) => {
  console.log("Received book data:", data);

  return (
    <div className='flex flex-row justify-center bg-gray-400'>
      <div className='bg-white '>
        <CustomImage name='bookMainPage' />
      </div>
      <div>
        <span>Home / Fantasy / The Throned Mirror</span>
      </div>
      {data && <p>{data.title}</p>}
    </div>
  );
};

export default SingleBookCard;
